{{Infobox settlement |name = Kittamaqundi |official_name = |settlement_type = [[Piscataway tribe]] [[Village]] |nickname = |motto = |image_skyline = Mouth of Piscataway Creek.jpg |imagesize = 250px |image_caption = [[Piscataway Creek]] |image_flag = |image_seal = |image_map = |mapsize = |map_caption = |image_map1 = |mapsize1 = |map_caption1 = |coordinates_region = US-MD |subdivision_type = Country |subdivision_name = |subdivision_type1 = |subdivision_name1 = |subdivision_type2 = Prince George's County |subdivision_name2 = {{nowrap|{{flagicon image|Flag of Prince George's County, Maryland.svg}} [[Prince George's County, Maryland|Prince George's]]}}
|government_type = |leader_title = Tayac |leader_name = |leader_title1 = |established_title = |established_date = Pre 1634 <!-- Area --> |unit_pref = Imperial |area_footnotes = |area_magnitude = |area_total_km2 = |area_land_km2 = |area_water_km2 = |area_total_sq_mi = |area_land_sq_mi = |area_water_sq_mi = |area_urban_sq_mi = |area_urban_km2 = |area_metro_sq_mi = |area_metro_km2 = <!-- Population --> |population_as_of = 2013 |population_est = Disbanded |pop_est_as_of = |population_footnotes = |population_total = |population_density_km2 = |population_density_sq_mi = |population_note = |population_metro = |population_urban = |timezone = [[North American Eastern Time Zone|EST]] |utc_offset = -5 |timezone_DST = [[Eastern Daylight Time|EDT]] |utc_offset_DST = -4 |coordinates_display = inline,title |coordinates_type = |elevation_m = |elevation_ft = |postal_code_type = |postal_code = |area_code = |website = |blank_name = |blank_info = |blank1_name = |blank1_info = |footnotes = }}
[[File:White piscataway.jpg|right|thumb|manuscript prayers written between 1634 and 1640 in English, Latin, and Piscataway in the hand of Andrew White SJ, the first Catholic missionary to the Maryland colony. In the blank Pages of an Edition of Manuale sacerdotum hoc est, ritus administrandi sacramenta. Printed in Douai 1610. In the Lauinger Library, University of Georgetown]]
The village of Kittamaqundi was formed on the [[Piscataway Creek]] in modern Prince George's County, Maryland by native Americans of the [[Piscataway tribe]].<ref>{{cite book|title=Maryland: A History of Its People|page=10}}</ref> In 1634, The village was named by English settlers Kittamaqundi after it's Tayac, Kittamaquund who had come to power that year after killing his brother Wannas<ref>{{cite book|title=Native America: A State-by-state Historical Encyclopedia, Volume 1|author=Daniel S. Murphree|page=487}}</ref> In 1640, [[Society of Jesus|Jesuits]] settled a mission at Kittamaqundi, and abandoned the village in 1643 after attacks from northern [[Susquehannock]] tribes. In 1644, The site was occupied by the British as a protective outpost.
==See also== *[[Piscataway tribe]] *[[Piscataway, Maryland]] *[[Lake Kittamaqundi]] - A man made lake in [[Columbia, Maryland]] in 1966, named by [[The Rouse Company]] developers claiming "Kittamaqundi" translates to "frendly meeting place".<ref>{{cite book|title=Howard County|author=The Howard County Historical Society|page=50}}</ref> *Kittamaqundi Community - A branch of the Washington D.C. baptist Church of the Savior formed in Columbia in 1970 by Gordon Cosby.<ref>{{cite book|title=Reforming Suburbia: The Planned Communities of Irvine, Columbia, and the Woodlands|author=Ann Forsyth|page=112}}</ref>
