{{Speciesbox | taxon = Lophocochlias minutissimus | image = | image_caption = | authority = (Pilsbry, 1921) | synonyms_ref = | synonyms = ''Haplocochlias (Lophocochlias) minutissimus'' <small>Pilsbry, 1921</small> (original combination) | display_parents = 3 }}
'''''Lophocochlias minutissimus''''' is a [[species]] of [[sea snail]], a marine [[gastropod]] [[mollusk]] in the [[family (biology)|family]] [[Skeneidae]].<ref name="WoRMS">Gofas, S. (2013). Lophocochlias minutissimus (Pilsbry, 1921). Accessed through: World Register of Marine Species at http://www.marinespecies.org/aphia.php?p=taxdetails&id=730993 on 2013-11-04</ref>
==Description== The height of the shell attains 1 mm, its diameter0.9 mm. The very small, white shell is umbilicate, turbinate, not nacreous, with a conic brownish [[Spire (mollusc)|spire]]. The first [[Whorl (mollusc)|whorl]] appears to be smooth. On the second whorl fine radial folds or puckering appears below the [[Suture (anatomy)|suture]], becoming coarser on the following whorl. The [[body whorl]] has six strong, smooth spiral keels, narrower than the intervals, which are flat and crossed by numerous retractively axial threads, which are much narrower than their intervals. Within the [[Umbilicus (mollusc)|umbilicus]] two rather small spiral cords are seen. The [[Aperture (mollusc)|aperture]] is quite oblique and subcircular. The outer [[Lip (gastropod)|lip]] is strengthened by a rounded external rib or varix a short distance behind the edge. <ref> [http://biodiversitylibrary.org/page/3819815 Pilsbry H.A. 1921. Marine mollusks of Hawaii, XIV-XV. Proceedings of the Academy of Natural Sciences, 72: 360-383] (described as ''Haplocochlias (Lophocochlias) minutissimus'' )</ref>
==Distribution== This marine species occurs in the Pacific Ocean off [[Hawaii]].
==References== {{reflist}} * Kay, E.A. (1979) ''Hawaiian marine shells. Reef and shore fauna of Hawaii. Section 4: Mollusca''. Bernice P. Bishop Museum Special Publications, 64, xviii + 1–653
