{{Portal|Anglicanism}} The Very Reverend ''' Harold Percy Fewtrell '''  was [[Dean of Hobart]]<ref>[http://www.london-gazette.co.uk/issues/39743/pages/96/page.pdf London Gazette]</ref> from 1942<ref>[http://trove.nla.gov.au/ndp/del/page/1861477 Trove]</ref> to 1958.<ref>[http://www.tasmaniananglican.com/ta200409-14/ Tasmanian Anglican]</ref>

He was educated at [[Bishop Hatfield's Hall]] <ref>[[Crockford's Clerical Directory]] 1959-60 p383: Oxford, OUP, 1959</ref> and [[ordained]] in 1915.  he began his career with   a [[Curate|curacy]] in [[Kennington]]. Emigrating to [[Australia]] he was the  [[Rector (ecclesiastical)|Rector]] of [[Cessnock, New South Wales]] from 1921 to 1925. After further [[Incumbent (ecclesiastical)|incumbencies]] in [[Yallourn]] and  [[Parramatta]] he was the [[Headteacher|Head Master]] at [[Ballarat Grammar School| Ballarat Church of England Grammar School for Boys]] until his appointment as [[Dean (religion)|Dean]].

He died in 1970.<ref>[http://www.heavenaddress.com/Harold-Percy-Fewtrell/115983/ Heaven Address]</ref>
