A hymn sung during a zikr or Turkish Mevlevi Sufi ritual. It is generally based on a specific makam and usul, and the words are taken from a Sufi poem in praise of God, the Prophet Muhammad or the Sufi saints. <ref>[http://www.oud.eclipse.co.uk/turkishforms.html Turkish Music forms]</ref>
