{{Portal|Anglicanism}} The Very Reverend ''' Eric (Michael) Webber  ''', [[Associateship of King's College|AKC]]  was [[Dean of Hobart]] from 1959<ref>[[Crockford's Clerical Directory]] 1959-60 p1236: Oxford, OUP, 1959</ref> to 1971.<ref>[http://www.tasmaniananglican.com/ta200409-14/ Tasmanian Anglican]</ref>

He was educated at [[King’s College London]]; and [[ordained]] in 1943.  He began his career with   a [[Curate|curacies]] in [[Clapham]] and [[Wimbledon]]. He was the  [[Rector (ecclesiastical)|Rector]] of [[Eshowe]] from 1951 to 1956; and of [[Lapworth]] with [[Baddesley Clinton]] until his appointment as [[Dean (religion)|Dean]].
