{{Infobox boxer |name=Nicky Wilshire |image= |realname=Nicholas Wilshire |nickname= |weight=[[light middleweight|light middle]]/[[middleweight]] |height={{height|ft=5|in=8}} |reach=<!--{{convert|0|in|cm|0|abbr=on}}--> |nationality=[[English people|English]] |birth_date={{birth date and age|1961|11|03|df=y}} |birth_place=[[Bristol]], England |death_date= |death_place= |style=[[Southpaw stance|Southpaw]] |total=40 |wins=36 ([[Knockout|KO]] 31) |losses=4 (KO 1) |draws= |no contests= |medaltemplates= }} '''Nicky Wilshire''' ({{birth date and age|1961|11|03|df=y}}) born in [[Bristol]] is an [[English people|English]] [[amateur]] [[light middleweight|light middle]]/[[middleweight]] and [[professional]] [[light middleweight|light middle]]/[[middleweight]] [[Boxing|boxer]] of the 1970s and '80s who as an amateur won the 1979 [[Amateur Boxing Association of England]] (ABAE) middleweight title, defeating [[Douglas James]] (RAOB ABC),<ref name="92nd ABAE National Championship">{{cite web|url=http://www.abae.co.uk/aba/index.cfm/boxers/roll-of-honour/elite-abae-championship/1970-1979/1979/|title=92nd ABAE National Championship|publisher=abae.co.uk|date=31 December 2012|accessdate=1 January 2013}}</ref> boxing out of National Smelting ABC, was runner-up in the 1980 [[Amateur Boxing Association of England]] (ABAE) light middleweight title, losing to [[James Price (boxer)|James Price]] (Holy Name ABC),<ref name="93rd ABAE National Championship">{{cite web|url=http://www.abae.co.uk/aba/index.cfm/boxers/roll-of-honour/elite-abae-championship/1980-1989/1980/|title=93rd ABAE National Championship|publisher=abae.co.uk|date=31 December 2012|accessdate=1 January 2013}}</ref> boxing out of National Smelting ABC, and represented Great Britain at light middleweight in the [[Boxing at the 1980 Summer Olympics|Boxing at the]] [[1980 Summer Olympics]] in [[Moscow]], [[Soviet Union]], defeating [[Miodrag Perunović]] of [[Yugoslavia]], and losing to eventual [[silver medal]] winner [[Aleksandr Koshkyn]] of the [[Soviet Union]], and as a professional won the [[List of Commonwealth Boxing Council Champions#light middleweight|Commonwealth light middleweight title]], and was a challenger for the [[British Boxing Board of Control]] (BBBofC) British light middleweight title title against [[Jimmy Cable]], and [[Lloyd Hibbert]], his professional fighting weight varied from {{convinfobox||kg||st|152+3/4|lb|}}, i.e. [[light middleweight]] to {{convinfobox||kg||st|158|lb}}, i.e. [[middleweight]].<ref name="Statistics at boxrec.com">{{cite web|url=http://boxrec.com/list_bouts.php?human_id=41348&cat=boxer|title=Statistics at boxrec.com|publisher=boxrec.com|date=31 December 2013|accessdate=1 January 2013}}</ref>
