[[Image:Seal of the United States Supreme Court.svg|right|175px]] The [[Supreme Court of the United States]] has handed down two ''[[per curiam]]'' opinions during its 2013 term, which began October 7, 2013 and will conclude October 5, 2014.<ref>The description of one opinion has been omitted; the Court's opinion in ''Madigan v. Levin'', 571 U.S. ___ (2013), was a one-line dismissal of certiorari as improvidently granted.</ref>
Because ''per curiam'' decisions are issued from the Court as an institution, these opinions all lack the attribution of authorship or joining votes to specific justices. All justices on the Court at the time the decision was handed down are assumed to have participated and concurred unless otherwise noted.
{{TOC limit|limit=2}}
==Court membership==
Chief Justice: [[John Roberts]]
Associate Justices: [[Antonin Scalia]], [[Anthony Kennedy]], [[Clarence Thomas]], [[Ruth Bader Ginsburg]], [[Stephen Breyer]], [[Samuel Alito]], [[Sonia Sotomayor]], [[Elena Kagan]]
==''Stanton v. Simms''== {{SCOTUS per curiam |fullcasename=Mike Stanton v. Drendolyn Simms |citation=571 U.S. ___ |datedecided=November 4, 2013 |summary=A bystander was seriously injured when a police officer, in [[hot pursuit]] of a misdemeanor suspect, kicked open the gate to her yard. She sued the officer for violating her Fourth Amendment rights by his warrantless entry into the [[curtilage]] of her property, but the district court held that the officer was entitled to [[qualified immunity]] and granted him [[summary judgment]]. On appeal, the [[United States Court of Appeals for the Ninth Circuit|Ninth Circuit]] reversed, ruling that there was no basis for warrantless entry because there were no [[exigent circumstances]] and the fleeing suspect's alleged offense was minor.
The Supreme Court reversed the Ninth Circuit, finding that the officer was entitled to qualified immunity because there was not "clearly established law" on the issue. Instead, federal and state courts were "sharply divided on the question whether an officer with probable cause to arrest a suspect for a misdemeanor may enter a home without a warrant while in hot pursuit of that suspect." The officer could, therefore, not be found "plainly incompetent" in violating the plaintiff's constitutional rights. |priorhistory=Summary judgment granted to defendant, No. 3:09-cv-01356 ([[United States District Court for the Southern District of California|S.D. Cal]].); rev'd, [http://cdn.ca9.uscourts.gov/datastore/opinions/2013/01/16/11-55401.pdf 706 F. 3d 954] ([[United States Court of Appeals for the Ninth Circuit|9th Cir.]] 2013) |subsequenthistory= |lawsapplied=[[Fourth Amendment to the United States Constitution|U.S. Const. amend. IV]] |wikisource= |source1=official slip opinion |sourceurl1=http://www.supremecourt.gov/opinions/13pdf/12-1217_bpmc.pdf |source2= |sourceurl2= |source3= |sourceurl3= |source4= |sourceurl4= |source5= |sourceurl5= }}
