'''KCAC''' (1010 [[AM broadcasting|AM]]) was a [[Freeform (radio format)|freeform]] [[radio station]] in [[Phoenix]], [[Arizona]], which only broadcast in that format for two years (1969-71). However, it had a major impact on Phoenix's [[counter culture]] of that time and its DJs formed the basis of [[KDKB|KDKB-FM]], which has gone on to be a notable [[Album Oriented Rock]] station.
==History== KCAC switched to a freeform format when it was purchased by [[William Edward Compton]], who managed the station until it went off the air in 1971. Compton then collaborated with KDKB co-owner Dwight Tindle to "invent" KDKB and its air sound.<ref>{{cite web | last = Tindle | first = C. Dwight | year = 2011 | url = http://www.dwighttindle.com/KDKB/birthpangs.html | title = Birth Pangs | format = | work = | publisher = | accessdate = September 26, 2013 }}</ref>
