'''Baloda Bazar distict''' is a district in Chhattisgarh state of India with its headquarter at [[Baloda Bazar]]. Before its creation, it is part of Raipur district.


==Administration==
The district is sub divided in  6 development Blocks called Tahsils, namely Palari, Baloda Bazar, Kasdol, Bilaigarh, Bhatapara and Simga and 3 Sub-divisions namely Baloda Bazar, Bhatapara and Bilaigarh. 

The district administration is headed by the district magistrate cum Collector, present Collector and District Magistrate to take charge of the newly formed district is Rajesh Sukumar Toppo, an [[IAS]] officer of 2005 batch.
