'''Trayan Marechkov''' ({{lang-bg|Траян Маречков}}), 26 years, is the first<ref>[http://www.24chasa.bg/Article.asp?ArticleId=1843783 Почетоха Траян - първият човек-факла]</ref> <ref>[http://www.vesti.bg/index.phtml?tid=40&oid=5631371 Десетина души запалиха свещи пред президентството]</ref> to set himself on fire in Bulgaria. He set himself on fire on February 18, 2013 in [[Veliko Tarnovo]] and died of his wounds shortly afterwards. According to some publications Marechkov had mental problems and was unemployed. The exact causes of self-immolation are not clear.<ref>[http://www.borbabg.com/?action=news&news=24117 26-годишен търновец се самозапали заради мизерията]</ref> <ref>[http://radiovelikotarnovo.com/news/5861 Двадесетина търновци почетоха паметта на запалилия се 26-годишен Траян Маречков]</ref> Leave a suicide note, saying'' "I give my life for the people, family and Bulgaria in the hope that politics and government will improve the standard of the people"''.<ref>[http://www.focus-news.net/?id=n1760425 20 души запалиха свещ в памет на 26-годишния Траян Маречков, който се самозапали във Велико Търново]</ref>
