{{Portal|Anglicanism}} The Very Reverend '''Harlin John Lascelles Butterly''' (1927-2012<ref>[http://www.tasmaniananglican.com/ta201204-02/ Brief biography]</ref>)  was [[Dean of Hobart]] from 1972<ref>''[[Crockford's Clerical Directory]] 1980-82'' p155 London: Oxford University Press, 1976 ISBN 0192000101</ref> to 1971.<ref>[http://www.tasmaniananglican.com/ta200409-14/ Tasmanian Anglican]</ref>

He was educated at [[Moore College]]; and [[ordained]] in 1951.  He began his career with [[Curate|curacies]] in [[Narabeen]] and [[Mascot]]. He was the  [[General Secretary]] of the [[Church Mission Society|CMS]] in [[Tasmania]] from 1954 to 1957; and a [[Chaplain]] at St Stephen's College, [[Hong Kong]] for a [[decade]] after that. From 1971 until his appointment as [[Dean (religion)|Dean]] he was a [[Chaplain]] to the [[British Armed Forces|Forces]].<ref>[http://www.london-gazette.co.uk/issues/44247/supplements/1701/page.pdf London Gazette]</ref>

He died in January 2012.<ref>[http://www.thelastpost.com.au/search-results.php?ID=167384 The Last Post]</ref>
