[[File:Mariana Fruit Bat.jpg|thumbnail|The Mariana fruit bat ''(P. mariannus mariannus)'' is a part of the island's traditional cuisine.]]
[[File:Chamorro Village1.JPG|left|thumb|Chamorro Village]] 
Historically, the inhabitants of Guam ate fish, fowls, rice, breadfruit, taro, yams, bananas, coconuts, and cycas nuts. For relishes, they ate certain seaweeds and Terminalia nuts. Ripe coconuts was used in several dishes. They cooked by means of heated stones in a heated pit, very much after the method used by the modern Polynesians. The principal plants cultivated by the natives before the European discovery were the [[breadfruit]], [[dugdug]], gum, [[betel palm]], [[betel pepper]], rice, sugar cane, coconuts, yams, [[taro]], [[Polynesian arrowroot]], [[turmeric]], [[wild ginger]], and a species of red pepper, called ''doni''. The principal plants introduced by the missionaries were maize, tobacco, oranges, lemons, limes, pineapples, cashew nuts, or [[marafione]]s, peanuts, egg plants, tomatoes, and several species of [[Annona]], besides a number of leguminous vegetables and garden herbs. Coffee and cacao were introduced later.{{sfn|Safford|1912|pp=13–14}}

Modern-day cuisine of Guam is a product created by a conclave of people of the indigenous tribes of Chamorro, Filipino,  Pacific Islanders, Asians and whites. Spanish colonialism of 200 years also has a strong influence on the cuisine blended with present American regime. Some of the popular dishes are the [[Chorizo Breakfast Bowl]], the [[Jamaican Grill]], red rice as side dish cooked with red seeds of the [[achiote tree]] and Filipino inspired desert called the [[Banana Lumpia]].<ref name=Culture>{{Cite web|url=http://www.bbc.com/travel/feature/20110207-guam-the-best-place-you-never-considered-going-to|title=Guam: The best place you never considered going to|date=7 February 2011|accessdate=21 October 2013|publisher=BBC.Com}}</ref> ''[[Mariana fruit bat|P. mariannus mariannus]]'' is a feature of traditional Chamorro cuisine.{{sfn|Quammen|2012|p=131-132}} Other local ingredients in Guam's cuisine include fresh fish, such as tuna, as well as breadfruit, coconut, [[papaya]], taro, and yams.{{sfn|Hanauer|2001|p=13}} [[Chicharrón]], [[Guyuria]], [[Roskette]], and [[Kalamai]] are typical dishes. [[Chamorro (village)|Chamorro]] village in [[Hagatna]], which is spread over an area of {{convert|4|acres}}, is popular on weekends, particularly for night life of traditional ethnic dances, music and special food items such as coconut juice and plates of Guam-styled barbecue.<ref name=Culture/>

