[[Air Vice-Marshal]] '''Michael  P Donaldson''' [[Order of the British Empire|MBE]]  was a senior British [[Royal Air Force]] officer in the 1980s/1990s and the 22nd [[Commandant Royal Observer Corps]] <ref>http://www.rafweb.org/Grp09.htm</ref>.

He was educated at [[Chislehurst and Sidcup Grammar School]], [[Sidcup]] in the [[London Borough of Bexley]], England

Donaldson was promoted to Group Captain in 1987 and appointed as Officer Commanding RAF Wattisham, a position he held until the station's flying activities were stepped down in 1989. Promoted to Air Commodore on 1 April 1992 he was appointed as Senior Air Staff Officer (SASO) of [[No. 11/18 Group RAF]], simultaneously holding the appointment of 22nd [[Commandant Royal Observer Corps]] (ROC) at a time when the majority of the ROC had been stood down, leaving a small number of Nuclear Reporting Cell observers serving at various Armed Forces HQs all over the UK.

On 1 February 1993 Donaldson handed over both appointments to Air Commodore [[Cliff Spink]], after he was promoted to Air Vice-Marshal and appointed as Commandant of the RAF Staff College, Bracknell. He held this position until 15 January 1996 and retired from the RAF later that year on 14 September. On leaving the RAF he became Principal of [[Yorkshire Coast College]]  where he remained until retirement in 2003.

